import './App.css';
import {useEffect, useState} from "react";
import Loader from "././componetns/loader"
import {Nav} from "./componetns/nav"



function App() {

    const [loading, setLoading] = useState(false);

    useEffect(() => {
        setLoading(true)
        setTimeout(() =>{
            setLoading(false)
        }, 1000)
    }, [])

  return (
    <div className="App">
        {
        loading ?
            <Loader/>
        :

            <header>
            <Nav/>
            </header>

        }



    </div>
  );
}

export default App;
